import React, { useEffect, useState } from 'react';

const Dashboard = () => {
  const [designs, setDesigns] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    // Replace YOUR_JWT_TOKEN with the actual token stored after login
    const token = localStorage.getItem('token') || 'YOUR_JWT_TOKEN';

    fetch('http://localhost:5000/api/designs', {
      headers: {
        'Authorization': `Bearer ${token}`,
      },
    })
      .then((res) => res.json())
      .then((data) => {
        console.log('API Response:', data);
        if (Array.isArray(data)) {
          setDesigns(data);
        } else if (data.designs && Array.isArray(data.designs)) {
          setDesigns(data.designs);
        } else {
          setDesigns([]);
          console.warn('Unexpected API response format');
        }
        setLoading(false);
      })
      .catch((err) => {
        console.error('Error fetching designs:', err);
        setLoading(false);
      });
  }, []);

  if (loading) return <div>Loading designs...</div>;

  return (
    <div>
      <h2>Your Designs</h2>
      {designs.length === 0 ? (
        <p>No designs found.</p>
      ) : (
        <ul>
          {designs.map((design) => (
            <li key={design._id}>
              <h3>{design.title}</h3>
              {design.thumbnailUrl ? (
                <img src={design.thumbnailUrl} alt="Thumbnail" width="200" />
              ) : (
                <p>No thumbnail available.</p>
              )}
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default Dashboard;
